import Folder from "./Folder";
import { useState, useEffect } from "react";

const Folders = (props) => {
  const [sprawy, ustawSprawy] = useState([]);

  useEffect(() => {
    getSprawy();
  });

  const getSprawy = () => {
    if (props.type == "obywatele_ue") {
      ustawSprawy(katalogi.obywatel_ue);
    } else if (props.type == "obywatele_wb") {
      ustawSprawy(katalogi.obywatel_wb);
    } else if (props.type == "obywatele_pt") {
      stawSprawy(katalogi.obywatel_pt);
    }
  };
};

export default Folders;
